# + id="Avnhy0ZkEgl2" colab={"base_uri": "https://localhost:8080/", "height": 282} executionInfo={"status": "ok", "timestamp": 1629013430166, "user_tz": -540, "elapsed": 1158, "user": {"displayName": "\uc591\ub355\ud45c", "photoUrl": "", "userId": "16565402416710841856"}} outputId="5c6b9297-08f2-4a86-ae63-dacfa4c529c1"
