# + [markdown] id="_v1V-BaEEgl8"
# ### 1.3.3. 시간 변수

# + id="kq6wOtghEgl8" executionInfo={"status": "ok", "timestamp": 1629013437569, "user_tz": -540, "elapsed": 4, "user": {"displayName": "\uc591\ub355\ud45c", "photoUrl": "", "userId": "16565402416710841856"}}
# 시간 변수를 생성하는 함수 정의
def lag_function(df, var_name, past):
    # df = 시간변수를 생성할 데이터 프레임
    # var_name = 시간변수 생성의 대상이 되는 변수 이름
    # past = 몇 년 전의 성적을 생성할지 결정 (정수형)
    df.reset_index(drop=True, inplace = True)
    
    #시간변수 생성
    df['lag'+str(past)+'_'+var_name] = np.nan
    df['lag'+str(past)+'_'+'AB'] = np.nan
    
    for col in ['AB', var_name]:
        for i in range(0,(max(df.index)+1)):
            val = df.loc[(df['batter_name'] == df['batter_name'][i]) & 
                         (df['year'] == df['year'][i] - past), col]
            # 과거 기록이 결측치가 아니라면 값을 넣기
            if(len(val) != 0):
                df.loc[i, 'lag' + str(past) + '_' + col] = val.iloc[0]

    #30타수 미만 결측치 처리
    df.loc[df['lag' + str(past) + '_' + 'AB'] < 30, 
           'lag' + str(past) + '_' + var_name] = np.nan
    df.drop('lag' + str(past) + '_' + 'AB', axis = 1, inplace = True)

    return df


# + colab={"base_uri": "https://localhost:8080/", "height": 204} id="c4Ol9AiaJGDL" executionInfo={"status": "ok", "timestamp": 1629013959143, "user_tz": -540, "elapsed": 272, "user": {"displayName": "\uc591\ub355\ud45c", "photoUrl": "", "userId": "16565402416710841856"}} outputId="d112855e-5978-472a-c572-953cb27c135e"
# 상관관계를 탐색할 변수 선택
numerics = ['int16', 'int32', 'int64', 'float16', 'float32', 'float64']
numeric_cols = list(regular_season_df.select_dtypes(include=numerics).drop(
    ['batter_id','year','OPS','SLG'], axis =1).columns)
regular_season_temp = regular_season_df[numeric_cols + ['year', 'batter_name']].copy()
regular_season_temp = regular_season_temp.loc[regular_season_temp['AB'] >= 30]
regular_season_temp.head()

# + colab={"base_uri": "https://localhost:8080/", "height": 224} id="nwKJPogmJm8i" executionInfo={"status": "ok", "timestamp": 1629014077275, "user_tz": -540, "elapsed": 109482, "user": {"displayName": "\uc591\ub355\ud45c", "photoUrl": "", "userId": "16565402416710841856"}} outputId="42f3d329-00f4-4f5e-9f50-09918687f382"
# 시간변수 생성 함수를 통한 지표별 1년 전 성적 추출
for col in numeric_cols:
    regular_season_temp = lag_function(regular_season_temp, col, 1)
regular_season_temp.head()

# + colab={"base_uri": "https://localhost:8080/", "height": 224} id="GecA7_UFLk7S" executionInfo={"status": "ok", "timestamp": 1629014081160, "user_tz": -540, "elapsed": 264, "user": {"displayName": "\uc591\ub355\ud45c", "photoUrl": "", "userId": "16565402416710841856"}} outputId="485bb68c-b835-490e-a575-737322f7ab4b"
