# + id="f57f_XTFEgl_" executionInfo={"status": "ok", "timestamp": 1629014677049, "user_tz": -540, "elapsed": 275, "user": {"displayName": "\uc591\ub355\ud45c", "photoUrl": "", "userId": "16565402416710841856"}}
def wrmse(v,w,p):
    # v: 실제값
    # w: 타수
    # p: 예측값
    return sum(np.sqrt(((v-p)**2 * w) / sum(w)))


